description:
Zuid-Korea / Verenigde Staten
Fantasy
90 minuten

goed

met Jason Behr, Amanda Brooks en Robert Forster

Vijfhonderd jaar geleden vocht de Koreaanse krijger Haram met Imoogi serpent Buraki, een 200 meter lang mythisch monster, om 
zijn geliefde, Narin, te redden. Nu zijn de Imoogi terug op aarde en verwoesten zij Los Angeles. Verslaggever Ethan Kendrick 
wordt ingeschakeld om de zaak te onderzoeken. Hij komt erachter dat Sarah Daniels hem hierbij zal moeten helpen.
